system.admin_config_icheck:
  path: '/admin/config/icheck'
  defaults:
    _controller: '\Drupal\system\Controller\SystemController::systemAdminMenuBlockPage'
    _title: 'icheck'
  requirements:
    _permission: 'access administration pages'
admin.icheck.settings_form:
  path: '/admin/config/icheck/icheck'
  defaults:
    _form: 'Drupal\icheck\Forms\IcheckSettingForm'
    _title: 'icheck'
  requirements:
    _permission: 'administer site configuration'
